		'There are no elements to import based on your XPath.<br/><br/>If you are on the Create Filters screen, you probably specified filtering options that don’t match any elements present in your file.<br/>If you are seeing this error elsewhere, it means that while the XPath expression for your initial import matched some elements in your file previously, there are now zero elements in the file that match this expression.<br/>You can edit the XPath for your import by going to the Manage Imports -> Import Settings page.' => 'Nincsenek importálható elemek az XPath alapján.<br/><br/>Ha a Create Filters képernyőn vagy, valószínűleg olyan szűrési beállításokat adtál meg, amelyek nem felelnek meg a fájlodban található elemeknek.<br/>Ha máshol látod ezt a hibát, az azt jelenti, hogy bár az első importhoz használt XPath-kifejezés korábban illeszkedett a fájl egyes elemeire, most már nulla elem felel meg ennek a kifejezésnek a fájlban.<br/>Az importod XPath-ját a Manage Imports -> Import Settings oldalon tudod szerkeszteni.',
