		'Unable to download feed resource.' => 'Nem sikerült letölteni a feed erőforrást.',
		'Please confirm you are importing a valid feed.<br/> Often, feed providers distribute feeds with invalid data, improperly wrapped HTML, line breaks where they should not be, faulty character encodings, syntax errors in the XML, and other issues.<br/><br/>WP All Import has checks in place to automatically fix some of the most common problems, but we can’t catch every single one.<br/><br/>It is also possible that there is a bug in WP All Import, and the problem is not with the feed.<br/><br/>If you need assistance, please contact support – <a href="mailto:support@wpallimport.com">support@wpallimport.com</a> – with your XML/CSV file. We will identify the problem and release a bug fix if necessary.' => 'Kérjük, erősítsd meg, hogy érvényes feedet importálsz.<br/> Gyakran előfordul, hogy a feed szolgáltatók érvénytelen adatokkal, helytelenül becsomagolt HTML-lel, nem odaillő sortörésekkel, hibás karakterkódolással, XML szintaktikai hibákkal és egyéb problémákkal terjesztik a feedeket.<br/><br/>A WP All Import ellenőrzésekkel igyekszik automatikusan javítani a leggyakoribb problémákat, de nem tudunk mindent elkapni.<br/><br/>Az is lehetséges, hogy a WP All Importban van hiba, és a probléma nem a feeddel van.<br/><br/>Ha segítségre van szükséged, keresd a támogatást – <a href="mailto:support@wpallimport.com">support@wpallimport.com</a> – az XML/CSV fájloddal. Azonosítjuk a problémát, és szükség esetén kiadunk egy hibajavítást.',
