		'This combination of options is potentially destructive. When re-run, %s created or updated by this import and no longer present in the import file will be deleted with no option for recovery.' => 'Ez az opciókombináció potenciálisan romboló. Újrafuttatáskor az ezzel az importtal létrehozott vagy frissített, de az importfájlban már nem szereplő %s visszaállítási lehetőség nélkül törlődik.',
		'This combination of options can affect all %s on this site, even those not created by this import. During import, all %s not present in this import file will be moved to the trash.' => 'Ez az opciókombináció a webhely összes %s elemére hatással lehet, még azokra is, amelyeket nem ez az import hozott létre. Az import során minden, az importfájlban nem szereplő %s a kukába kerül.',
		'This combination of options can affect all %s on this site, even those not created by this import. During import, all %s not present in this import file will be moved to <span class="status_of_removed">draft</span>.' => 'Ez az opciókombináció a webhely összes %s elemére hatással lehet, még azokra is, amelyeket nem ez az import hozott létre. Az import során minden, az importfájlban nem szereplő %s <span class="status_of_removed">vázlat</span> állapotba kerül.',
