		' When this import is re-run in the future, %s created or updated by this import and no longer present in the import file will be sent to the trash.' => ' Amikor ezt az importot a jövőben újra lefuttatja, az ezzel az importtal létrehozott vagy frissített, de az importfájlban már nem szereplő %s a kukába kerül.',
