		' When this import is re-run in the future, %s created or updated by this import and no longer present in the import file will be sent to <span class="status_of_removed">draft</span>.' => ' Amikor ezt az importot a jövőben újra lefuttatja, az ezzel az importtal létrehozott vagy frissített, de az importfájlban már nem szereplő %s <span class="status_of_removed">vázlat</span> állapotba kerül.',
