		'Consider testing this import with removed records sent to the trash to make sure that the import is configured correctly and that the record matching settings are working as expected. We highly recommend running this import in staging first, and creating site backups before running in production.' => 'Fontolja meg, hogy tesztelje ezt az importot úgy, hogy az eltávolított rekordok a kukába kerüljenek, hogy megbizonyosodjon arról, hogy az import megfelelően van beállítva, és hogy a rekord-illesztési beállítások a vártnak megfelelően működnek. Erősen javasoljuk, hogy először tesztkörnyezetben futtassa ezt az importot, és készítsen biztonsági mentéseket a webhelyről, mielőtt élesben futtatja.',
		'Consider testing this import by setting a custom field instead of deletion to make sure that the import is configured correctly and that the record matching settings are working as expected. We highly recommend running this import in a staging environment first and creating site backups before running in production.' => 'Fontolja meg, hogy ezt az importot törlés helyett egy egyedi mező beállításával tesztelje, hogy megbizonyosodjon arról, hogy az import megfelelően van beállítva, és hogy a rekord-illesztési beállítások a vártnak megfelelően működnek. Erősen javasoljuk, hogy először tesztkörnyezetben futtassa ezt az importot, és készítsen biztonsági mentéseket a webhelyről, mielőtt élesben futtatja.',
