		'Unique Identifier' => 'Egyedi azonosító',
		'Auto-detect' => 'Automatikus felismerés',
		'Adjusting the Unique Identifier<br/><br/>If you run this import again with an updated file, the Unique Identifier allows WP All Import to correctly link the records in your updated file with the %s it will create right now. If multiple records in this import file have the same Unique Identifier, only the first will be created. The others will be detected as duplicates.<br/><br/>If you find that the autodetected Unique Identifier is not unique enough you can drag in any combination of elements. The Unique Identifier should be unique for each record in this import file, and should stay the same even if this import file is updated. Things like product IDs, titles, and SKUs are good Unique Identifiers because they probably won\'t change. Don\'t use a description or price, since that might later change.' => 'Az egyedi azonosító módosítása<br/><br/>Ha ismét lefuttatja ezt az importot egy frissített fájllal, az egyedi azonosító lehetővé teszi, hogy a WP All Import helyesen összekapcsolja a frissített fájl rekordjait a most létrehozandó %s-szel. Ha több rekordnak ugyanaz az egyedi azonosítója ebben az importfájlban, csak az első kerül létrehozásra. A többiek duplikátumként lesznek észlelve.<br/><br/>Ha úgy találja, hogy az automatikusan észlelt egyedi azonosító nem elég egyedi, tetszőleges elemek bármilyen kombinációját húzhatja be. Az egyedi azonosítónak egyedinek kell lennie az importfájl minden rekordjára, és változatlanul kell maradnia akkor is, ha ez az importfájl frissül. Olyan dolgok, mint a termékazonosítók, címek és SKU-k jó egyedi azonosítók, mert valószínűleg nem változnak. Ne használjon leírást vagy árat, mivel ezek később megváltozhatnak.',
