		'Editing the unique identifier will dissociate all existing %s linked to this import. Future runs of the import will result in duplicates, as WP All Import will no longer be able to update these %s.' => 'Az egyedi azonosító szerkesztése leválasztja az ehhez az importhoz kapcsolódó összes meglévő %s-t. Az import jövőbeli futtatásai duplikátumokat eredményeznek, mivel a WP All Import többé nem tudja frissíteni ezeket a %s-ket.',
