		'records' => 'rekordot',
		'WP All Import must be able to process this many records in less than your server\'s timeout settings. If your import fails before completion, to troubleshoot you should lower this number. If you are importing images, especially high resolution images, high numbers here are probably a bad idea, since downloading the images can take lots of time - for example, 20 posts with 5 images each = 100 images. At 500Kb per image that\'s 50Mb that needs to be downloaded. Can your server download that before timing out? If not, the import will fail.' => 'A WP All Importnak képesnek kell lennie ennyi rekordot feldolgozni a kiszolgálója időkorlátjánál rövidebb idő alatt. Ha az importálás befejezés előtt meghiúsul, a hibaelhárításhoz csökkentse ezt a számot. Ha képeket importál, különösen nagy felbontásúakat, a magas érték itt valószínűleg rossz ötlet, mivel a képek letöltése sok időt vehet igénybe – például 20 bejegyzés 5 képpel egyenként = 100 kép. 500Kb/kép esetén ez 50Mb letöltendő adat. Le tudja a szervere ezt letölteni az időkorlát lejárta előtt? Ha nem, az importálás meghiúsul.',
		'Split file up into <strong>' => 'A fájl felosztása <strong>',
		'This option will decrease the amount of slowdown experienced at the end of large imports. The slowdown is partially caused by the need for WP All Import to read deeper and deeper into the file on each successive iteration. Splitting the file into pieces means that, for example, instead of having to read 19000 records into a 20000 record file when importing the last 1000 records, WP All Import will just split it into 20 chunks, and then read the last chunk from the beginning.' => 'Ez az opció csökkenti a nagy importok végén tapasztalható lassulást. A lassulást részben az okozza, hogy a WP All Importnak minden egymást követő iterációban egyre mélyebbre kell olvasnia a fájlban. A fájl darabokra osztása azt jelenti, hogy például ahelyett, hogy az utolsó 1000 rekord importálásakor egy 20000 rekordos fájlban 19000 rekordot kellene beolvasni, a WP All Import 20 részre bontja, és az utolsó részt az elejéről olvassa be.',
		'Increase speed by disabling do_action calls in wp_insert_post during import.' => 'Sebesség növelése a do_action hívások letiltásával a wp_insert_post-ban importálás közben.',
		'This option is for advanced users with knowledge of WordPress development. Your theme or plugins may require these calls when posts are created. Next action will be disabled: \'transition_post_status\', \'save_post\', \'pre_post_update\', \'add_attachment\', \'edit_attachment\', \'edit_post\', \'post_updated\', \'wp_insert_post\'. Verify your created posts work properly if you check this box.' => 'Ez az opció olyan haladó felhasználóknak szól, akik rendelkeznek WordPress-fejlesztési ismeretekkel. A témája vagy bővítményei igényelhetik ezeket a hívásokat bejegyzések létrehozásakor. A következő műveletek lesznek letiltva: \'transition_post_status\', \'save_post\', \'pre_post_update\', \'add_attachment\', \'edit_attachment\', \'edit_post\', \'post_updated\', \'wp_insert_post\'. Ellenőrizze, hogy a létrehozott bejegyzések megfelelően működnek, ha bejelöli ezt a négyzetet.',
